  const logo = useRef<SVGSVGElement>(null);
  const container = useRef<HTMLDivElement | null>(null);
  const tl = useRef<GSAPTimeline>();
  const { mainTimeline } = useContext(GsapContext);

  useEffect(() => {
    // Note that ref.current may be null. This is expected, because you may
    // conditionally render the ref-ed element, or you may forgot to assign it

    let ctx = gsap.context(() => {
      let logoWidth = gsap.getProperty("#logo", "width");
      let containerWidth = gsap.getProperty("#container", "width");

      gsap.set("#yellow-bar", {
        visibility: "hidden",
        opacity: 0,
        scaleX: 0,
        transformOrigin: "right",
      });
      gsap.set("#yellow-bar-1", {
        visibility: "hidden",
        opacity: 0,
        drawSVG: "0% 0%",
        scaleX: 0,
      });

      tl.current = gsap
        .timeline()
        .fromTo(
          "#yellow-bar",
          {
            visibility: "visible",
            opacity: 1,
          },
          {
            scaleX: 1,
            duration: 1,
            ease: "power4.inOut",
          }
        )
        .fromTo(
          "#yellow-bar-1",
          {
            visibility: "visible",
            opacity: 1,
          },
          {
            scaleX: 1,
            duration: 1,
            ease: "power4.inOut",
          },
          "-=1"
        )
        .fromTo(
          "path:not(#yellow-bar-1, #yellow-bar)",
          {
            visibility: "visible",
            opacity: 0,
            scaleY: 0,
          },
          {
            scaleY: 1,
            opacity: 1,
            duration: 1,
            ease: "power4.inOut",
          }
        )
        .to("#backdrop", { y: "-100%", duration: 0.75, ease: "power4.in" });
    }, container); // <- IMPORTANT! Scopes selector text

    return () => ctx.revert(); // cleanup
  }, []); // <- empty dependency Array so it doesn't re-run on every render

